import React from 'react';
import './shikhNames.css';

const shikhNames = React.memo(props => {
    // console.log(props)
    return (
        <div className='shikh-names' title={props.title} onClick={props.clicked}>
            <h6>{props.text}</h6>
        </div>
    )
});

export default shikhNames
